    [],nt"num_tags": 2,nt"name": "tewaukon-national-wildlife-refuge-annual-narrative-report-calendar-year-1977",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tewaukon NWR
    outlines Refuge accomplishments during the 1977 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, land acquisition activities, and the system status. Construction and
    maintenance are also described. Habitat management is covered; croplands, grasslands,
    wetlands, and forests are discussed. The wildlife section of the report discusses
    migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Items of interest are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
